import React, { Component } from 'react'

export class Addtodo extends Component {
    render() {
        return (
            <form style = {{display: 'flex'}}> 
                <input 
                type = "text" 
                name = "title" 
                style = {{flex: 10}}
                placeholder="Add Todo..."

                />
                <input 
                type = "submit" 
                value = "Submit" 
                className = "btn"
                style = {{flex: '1'}}   
                />
            </form>
        )
    }
}

export default Addtodo;
